function getPlace(placeNum)
{
	if(placeNum=='-1')	
	{
		document.write('---');
		return;
	}
	var aNum=new Number(placeNum);
	
	var num = aNum%100;
	document.write(city[num]);
 	//return city[num];
}


function aClass(Pid, Cid, iPid, iCid, Cname) {
	if (aClass.arguments.length < 5)
		alert("传入的参数错误！")
	else {
		this.PData  = Pid;
		this.CData = Cid;
		this.iPData = iPid;
		this.iCData = iCid;
		this.Text  = Cname;
	}
}


function chgbox(aSrc, aDes, aClass, aRemain){
	if (chgbox.arguments.length < 3)
		alert("传入的参数错误！")
	else if (aSrc.type != "select-one")
		alert("传入的参数错误！")
	else if (aClass == null)
		alert("aClass未定义错误！")
	else {
		if (aRemain==null)
			aRemain = 1;
		chgItem(aSrc.options[aSrc.selectedIndex].value, aDes, aClass, aRemain);
	}
}


function getCity(pNum,Num)
{
	if(Num=='-1')	
	{
		document.write('---');
		return;
	}
	else if(Num=='-00001')
	{
		document.write('不限');
		return;
	}
	
	getCitynum(f_Set0,pNum,Num);
}


function getCitynum(aClass,pNum,cNum)
{
	var aNum=new Number(pNum);
	
	var bNum=new Number(cNum);
	
	placenum = aNum;
	
	citynum = bNum;
	
	for (var i=0; i<aClass.length; i++)
	{			
		if (aClass[i].iPData==placenum && aClass[i].iCData==citynum)
		{
			
			document.write(aClass[i].Text);
			return;
					
				
		}
	}
}


 	 	 		 	  		 

function chgItem(aValue, aDes, aClass, aRemain){
	if (chgItem.arguments.length<3)
		alert("参数传入错误！")
	else if (aClass==null)
		alert("错误！aClass没有定义！")
	else{
		if (aRemain==null)
			aRemain = 1;
		deleteAllItem(aDes, aRemain);
		var jj=-1;
		for (var i=0; i<aClass.length; i++)
		{			
			if (aClass[i].PData==aValue)
			{
				jj = jj + 1;
				if (aClass[i].PData!="")
					if (jj<10)
						addItem(aDes, aClass[i].Text, aValue+'0'+jj);
					else 
						addItem(aDes, aClass[i].Text, aValue+jj);
			}
		}
				
	}
}


function deleteAllItem(aList, aRemain) {
	if(aList==null) return;
	for (var i=aList.options.length; i > aRemain-1; i--)
		aList.options[i] = null;
}    


function addItem(aList, aText, aValue) {
	var aOption = new Option(aText, aValue);
	eval("aList.options[aList.options.length]=aOption");
}


function change_area(aForm) {
	chgbox(aForm.province, aForm.city, f_Set0, 0);
}


function getcityindex(pNum,cNum)
{
	var aNum=new Number(pNum);
	var bNum=new Number(cNum);
	var j=0;
	for (var i=0; i<f_Set0.length; i++){
		if (f_Set0[i].iPData==aNum){
			j++;
			if (f_Set0[i].iCData==bNum)
				return j-1;
		}
	}
	return 0;
}
